package com.example;

public class ForLoopEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		
		for(int k=1;k<=3;k++)
		{
			for(int j=1;j<=2;j++)
			{
				for(int i=1;i<=1;i++)
				{
					System.out.println(i);
					
				}
				System.out.print(j);
				
			}
			
			System.out.print(k);
		}
		
	}

}
